import React,{Component} from 'react';
import Slider from 'react-slick';
import img1 from "./../img/img2.png";
import img2 from "./../img/img3.png";
const Slider1 = () => {

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    autoplay:true,
    autoplayspeed:100,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return(
      <div>
           <div>
      
        <Slider {...settings}>
          <div>
            <img src={img1}></img>
          </div>
          <div>
            <img src={img2}></img>
          </div>
         
        </Slider>
      </div>
      </div>
  );
};

export default Slider1;
